import ExpenseItem from "./ExpenseItem";

function NewExpense(props) {
  return (
    <div>
      <ExpenseItem
        title={props.title[0]}
        amount={props.amount[0]}
        date={props.date[0]}
      />
    </div>
  );
}

export default NewExpense;
